import React from 'react';

export default function Week({ week, onClick }) {
  const hasEvents = week.events && week.events.length > 0;
  const weekClass = hasEvents ? 'week-box has-events' : 'week-box';
  
  return (
    <div 
      className={weekClass}
      onClick={onClick}
      title={`Week ${week.week_number}: ${week.start_date.toDateString()} - ${week.end_date.toDateString()}`}
    >
      {hasEvents && <div className="event-indicator">{week.events.length}</div>}
    </div>
  );
}
